import React, { Component } from 'react';
import {connect} from 'react-redux'
import { actions } from './../redux/modules/students'
import _ from 'lodash'

import { studentsSelector, isFetchingSelector } from './../redux/selectors/studentsSelector'

class Students extends Component {
    componentDidMount(){
        this.props.getVal()
    }
    render() {
        const {valuts, isFetching} = this.props
        return valuts && !isFetching ?
            <div>
                {
                    _.map(valuts, valuts=><div key={valuts.id}>{valuts.id}</div>)
                }
            </div>
             :
            <div>Loading...</div>
    }

    handleClick(){
        this.props.reverseStudents()
    }
}

const mapDispatchToProps = {
    ...actions
}

const mapStateToProps = (state) => ({
    pupils:studentsSelector(state),
    isFetching:isFetchingSelector(state)
})

export default connect(mapStateToProps, mapDispatchToProps)(Students)
